$(document).ready(function () {

    (function ($) {
        "use strict";
        if ($(".home-wrapper").length !== 1) {
            return;
        }

        if (navigator.userAgent.indexOf("MSIE ") > -1 || navigator.userAgent.indexOf("Trident/") > -1) {
            var isBannerShown = FIJI_UI.MainNamespace.Utils.getCookie("SHOWN_UNSUPPORTED_BANNER");
            if (isBannerShown !== "true") {
                var unsupportedBanner = document.createElement("div");
                unsupportedBanner.innerHTML = '<b class="unsupported-browser__title">Unsupported Browser!</b>' +
                    '<p class="unsupported-browser__text">' +
                    'You are using ' +
                    '<b style="color: rgb(240, 171, 0);">IE11</b> ' +
                    'that will soon no longer be supported. If you would like to use our latest features, we recommend switching to alternative browsers like ' +
                    '<b>Chrome</b>, ' +
                    '<b>Firefox</b>, ' +
                    '<b>Safari</b> ' +
                    'and ' +
                    '<b>Edge</b>.' +
                    '</p>' +
                    '<button class="btn unsupported-browser__button">Close</button>';
                unsupportedBanner.className = "unsupported-browser unsupported-browser_visible";
                document.body.insertAdjacentElement("beforeend", unsupportedBanner);
                var $btn = $('.unsupported-browser__button'),
                    $banner = $('.unsupported-browser');

                $btn.on('click', function () {
                    $banner.removeClass('unsupported-browser_visible');
                    document.cookie = "SHOWN_UNSUPPORTED_BANNER=true";
                });
            }
        }
    })(jQuery);
});

SUPPORT.MainNamespace.slsSystemHealthStatusController = (function () {

    function loadMore($root, path, newIncidentalIncidentsPage, newPlannedIncidentsPage) {
        $.ajax({
            url: path,
            data: {
                incidentalPage: newIncidentalIncidentsPage,
                plannedPage: newPlannedIncidentsPage
            },
            success: function(data) {
                var sanitizedData = DOMPurify.sanitize(data);
                $root.html(sanitizedData);
            }
        });
    }

    return {

        init: function (path, currentIncidentalIncidentsPage, currentPlannedIncidentsPage) {
            var $btn = $('.system-news__btn');
            $btn.on('click', function (event) {
                if ($(event.target).closest('.system-news__btn--incident').length) {
                    loadMore($(event.target).closest('.slsSystemHealthStatusWrapper'),
                        path, currentIncidentalIncidentsPage + 1, currentPlannedIncidentsPage);
                } else if ($(event.target).closest('.system-news__btn--planned').length) {
                    loadMore($(event.target).closest('.slsSystemHealthStatusWrapper'),
                        path, currentIncidentalIncidentsPage, currentPlannedIncidentsPage + 1);
                }
                event.preventDefault();
            });
        }

    };

})();

SUPPORT.MainNamespace.SearchFormController = (function ($) {

    function openUrl(url, showInNewWindow) {
        if (showInNewWindow) {
            window.open(url, "_blank", "noopener,noreferrer");
        } else {
            window.location = url;
        }
    }

    function prepareEsAcademyUrl(NeededKeywordString) {
        var KeywordSearchStringMaster = "https://accounts.sap.com/saml2/idp/sso?sp=https://www.successfactors.eu/learninghub&RelayState=%2Fsf%2Flearning%3FdestUrl%3Dhttps%253a%252f%252fsaplearninghub%252eplateau%252ecom%252flearning%252fuser%252fdeeplink%255fredirect%252ejsp%253flinkId%253dCATALOG%255fSEARCH%2526sbArSel%253d%2526keywords%253dtr%2526selKeyWordHeader%253dtr%2526catSel%253d%2526srcSel%253dESAC%2526delMthSel%253d%2526ILDateFrm%253d%2526ILDateTo%253d%2526ILBlend%253d%2526ILSchd%253d%2526fromSF%253dY%26company%3Dlearninghub";
        var String2Edit = "tr";
        var KeyString = encodeURIComponent(NeededKeywordString);
        var EnableLang = KeyString.replace(/%/g, "%25");
        var Substitute = KeywordSearchStringMaster.replace(String2Edit, EnableLang);
        var Sub2 = Substitute.replace(String2Edit, EnableLang);
        var JustSpacesLeft = Sub2.replace(/\%2520/g, "%252b");
        var ReplaceEqual = JustSpacesLeft.replace(/%252bSUP/g, "%253dSUP");
        return ReplaceEqual.replace(/%2522/g, "%252522");
    }

    function prepareEsAcademyEGIUrl(NeededKeywordString) {
        var KeywordSearchStringMaster = "https://accounts.sap.com/saml2/idp/sso?sp=https://www.successfactors.eu/learninghub&RelayState=%2Fsf%2Flearning%3FdestUrl%3Dhttps%253a%252f%252fsaplearninghub%252eplateau%252ecom%252flearning%252fuser%252fdeeplink%255fredirect%252ejsp%253flinkId%253dCATALOG%255fSEARCH%2526sbArSel%253d%2526keywords%253dtr%2526selKeyWordHeader%253dtr%2526catSel%253dInstructorLed%2526srcSel%253dESAC%2526delMthSel%253dEGI%2526ILDateFrm%253d%2526ILDateTo%253d%2526ILBlend%253d%2526ILSchd%253dy%2526fromSF%253dY%26company%3Dlearninghub";
        var String2Edit = "tr";
        var KeyString = encodeURIComponent(NeededKeywordString);
        var EnableLang = KeyString.replace(/%/g, "%25");
        var Substitute = KeywordSearchStringMaster.replace(String2Edit, EnableLang);
        var Sub2 = Substitute.replace(String2Edit, EnableLang);
        var JustSpacesLeft = Sub2.replace(/\%2520/g, "%252b");
        var ReplaceEqual = JustSpacesLeft.replace(/%252bSUP/g, "%253dSUP");
        return ReplaceEqual.replace(/%2522/g, "%252522");
    }

    function prepareSapForMeUrl(sapForMeSearchPageUrl, sapForMeNoteUrl, searchTerm, searchTermParameterName) {
        var searchPageUrl;

        if (/^#?\d{1,10}$/.test(searchTerm)) {
            searchPageUrl = sapForMeNoteUrl + encodeURIComponent(searchTerm.replace(/^#/, ""));
        } else {
            searchPageUrl = sapForMeSearchPageUrl + encodeURIComponent("{\"" + searchTermParameterName + "\":\"" + searchTerm + "\"}");
        }
        return searchPageUrl;
    }

    return {

        initializeSearchSection: function (sapForMeSearchPageUrl, sapForMeNoteUrl,
                                           searchTermParameterName, searchFormId,
                                           showInNewWindow, searchSystem) {
            var $searchForm = $("#" + searchFormId);
            var $searchInput = $searchForm.find("input[type=search]").filter(":visible:first");

            $searchForm.submit(function (e) {
                e.preventDefault();
                var searchText = $.trim($searchInput.val());

                var url;
                if (searchSystem === 'ESACADEMY') {
                    url = prepareEsAcademyUrl(searchText);
                } else if (searchSystem === 'ESACADEMYEGI'){
                    url = prepareEsAcademyEGIUrl(searchText);
                } else if (searchText) {
                    url = prepareSapForMeUrl(
                        sapForMeSearchPageUrl,
                        sapForMeNoteUrl,
                        searchText,
                        searchTermParameterName
                    );
                }

                if (url) {
                    openUrl(url, showInNewWindow);
                }
            });
        }

    };
})(jQuery);
