SUPPORT.MainNamespace.NewsFeedController = (function () {

    "use strict";

    var configMap = {
            showLess: 'Show less',
            showMore: 'Show more',
            parentEl: 'section.slide',
            showClass: 'ui-toggler__control',
            targetClass: 'ui-toggler__target',
            overlayClass: 'ui-toggler__overlay',
            clearBgClass: 'ui-toggler__overlay--clear'
        }
    ;

    function digitizeLineHeight(lineHeight, fontSize) {
        // 1.3 - 'default' browser's line-height:
        return (lineHeight === 'normal') ? (1.3 * parseFloat(fontSize)) : parseFloat(lineHeight);
    }

    function getRGBValue($this) {
        // rgba(xxx,xxx,xxx,0) or rgba(0,0,0,0) or 'transparent':
        var rgbString = $this.closest(configMap.parentEl).css('background-color'),
            rgbPatt = /\d+,\s*\d+,\s*\d+/,
            zeroPatt = /0,\s*0,\s*0/,
            result = (rgbString === 'transparent') ? rgbString : rgbPatt.exec(rgbString)
        ;
        return (result === 'transparent' || zeroPatt.test(result)) ? '255, 255, 255' : result;
    }

    function calculateGradient($targetText) {
        $targetText.find('.' + configMap.overlayClass).each(function() {
            var $this    = $(this),
                rgbValue = getRGBValue($this)
            ;
            $this.css({
                'background-image' : 'linear-gradient(to top, rgba(' + rgbValue + ', 1) 0%, rgba(' + rgbValue + ', 0) 50%)'
            });
        });
    }

    function createOverlayArea($targetText) {
        var $overlayText = $(document.createElement('div'))
        ;
        $overlayText
            .appendTo($targetText)
            .addClass(configMap.overlayClass)
        ;
        $targetText
            .addClass(configMap.targetClass)
        ;
    }

    function createControlText($targetText, cachedHeight) {
        var $controlText = $(document.createElement('span'))
        ;
        $controlText
            .insertAfter($targetText)
            .addClass(configMap.showClass)
            .text(configMap.showMore)
            .on('click', function () {
                var $this = $(this),
                    $thisTargetText = $this.prev($targetText),
                    $thisOverlay = $thisTargetText.children('.' + configMap.overlayClass)
                ;
                if (cachedHeight === $thisTargetText.height()) {
                    $thisTargetText.animate({
                        // This property is stored in the DOM node as scrollHeight. We just have to fetch the DOM Element
                        // from the jQuery Element by calling get(0) and then we can access the property:
                        height: $thisTargetText.get(0).scrollHeight
                        // Adding a callback function to set "height: auto" allows better responsiveness once the animation is complete:
                    }, 100, function () {
                        // "height: auto" - The DOM already knows from its initial rendering what size the expanded div will have
                        // when set to auto height:
                        $thisTargetText.height('auto');
                        $thisOverlay.addClass(configMap.clearBgClass);
                        $this.text(configMap.showLess);
                    });
                } else {
                    $thisTargetText.animate({
                        height: cachedHeight
                    }, 100, function () {
                        $thisOverlay.removeClass(configMap.clearBgClass);
                        $this.text(configMap.showMore);
                    });
                }
            })
        ;
    }

    function initToggler(feedId, numberOfVisibleLines) {
        var $targetText = $('#' + feedId).find('.news__text');
        $targetText.each(function () {
            var cachedHeight,
                $this = $(this),
                targetHeight = $this.height(),
                targetLineHeight = digitizeLineHeight($this.css('line-height'), $this.css('font-size')),
                targetNumberLines = Math.round(targetHeight / targetLineHeight),
                targetLineRatio = targetNumberLines / numberOfVisibleLines
            ;
            if (targetNumberLines > numberOfVisibleLines) {
                $this.height(targetHeight / targetLineRatio);
                cachedHeight = $this.height();
                createOverlayArea($this);
                // Defer gradient calculation (this moves it to callback queue) until background color is applied to the section:
                setTimeout(function() {
                    calculateGradient($this);
                }, 0);
                createControlText($this, cachedHeight);
            }
        });
    }

    function loadMore($root, path, newNewsPage) {
        $.ajax({
            url: path,
            data: {
                newsPage: newNewsPage
            },
            success: function(data) {
                var sanitizedData = DOMPurify.sanitize(data);
                $root.html(sanitizedData);
            }
        });
    }

    return {

        init: function (newsFeedElementId, isTextShortenEnabled, numberOfVisibleLines, componentPath, currentNewsPage) {
            if (isTextShortenEnabled) {
                initToggler(newsFeedElementId, numberOfVisibleLines);
            }
            var $btn = $('.news__btn');
            $btn.on('click', function (event) {
                    loadMore($(event.target).closest('.newsFeedWrapper'),
                            componentPath, currentNewsPage + 1);
                event.preventDefault();
            });
        }

    };

})();

SUPPORT.MainNamespace.linkTransformerController = (function() {

    return {
        transformLinks : function(hrefReplaceArray) {
            if (hrefReplaceArray) {
                hrefReplaceArray.forEach(function(replaceRule) {
                    var newLink = replaceRule.newLink;
                    $('a[href="' + replaceRule.oldLink + '"]').each(function() {
                        if (newLink) {
                            $(this).attr("href", newLink);
                        }
                    });
                });
            }
        }
    };

})();
