SUPPORT.MainNamespace.WebChatController = (function (_$) {
    'use strict';

    function stickyWebChat(buttonSelector) {
        var footer = document.querySelector("#ds-footer");
        var footerTop = footer.offsetTop;
        var webChatButton = document.querySelector(buttonSelector);

        if (getWindowOffsetBottom() >= footerTop) {
            webChatButton.style.marginBottom = `${getWindowOffsetBottom() - footerTop}px`;
        } else {
            webChatButton.style.removeProperty('margin-bottom');
        }
    }

    function getWindowOffsetBottom() {
        return window.pageYOffset + window.innerHeight;
    }

    return {
        init: function (buttonSelector) {
            document.addEventListener('scroll', function() {
                stickyWebChat(buttonSelector);
            });
        }
    };
})(jQuery);

SUPPORT.MainNamespace.PilotInfoController = (function ($) {

    'use strict';

    var $btn, $panel, $close, $termsConditions, termsConditionClass;
    var directlyWidgetReady = false;

    function initChatWidget() {
        DirectlyAskForm.render();
        DirectlyRTM("onReady", function () {
            directlyWidgetReady = true;
        });
    }

    function openChatWidget() {
        if (directlyWidgetReady) {
            DirectlyAskForm.show();
            FIJI_UI.MainNamespace.PanelTrigger.triggerPanel($btn, $panel, $close);
        }
    }

    return {

        init: function (withChat, askAnExpertJSUrl) {
            // Currently there can be only one pilotInfo component on the page, therefore we do not need to rely on IDs
            $btn = $('.pilot-info__btn');
            $panel = $('.pilot-info__panel');
            $close = $('.pilot-info__panel-close');
            $termsConditions = $('.pilot-info__modal');
            termsConditionClass = 'pilot-info__modal--open';

            var $termsAgreementAccept = $termsConditions.find('.chat-ok-action'),
                $termsConditionsClose = $termsConditions.find('.chat-cancel-action');

            $btn.on('click', function () {
                FIJI_UI.MainNamespace.PanelTrigger.triggerPanel($btn, $panel, $close);
            });

            $close.on('click', function () {
                $btn.click();
            });

            $termsAgreementAccept.on('click', function () {
                openChatWidget();
            });

            $termsConditionsClose.on('click', function (e) {
                e.stopPropagation();
                $termsConditions.removeClass(termsConditionClass);
            });

            if (withChat) {
                $.ajax({
                    url: askAnExpertJSUrl,
                    dataType: 'script',
                    success: initChatWidget,
                    async: true
                });
            }
        },

        toggleTermsAndConditions: function () {
            $termsConditions.toggleClass(termsConditionClass);
        }
    };

})(jQuery);


SUPPORT.MainNamespace.NewNavigationPanelController = (function ($) {

    return {
        setHeaderNavigationSticky: function () {
            var header = $(".header-section");
            var headerWrapper = $('.header-wrapper');
            var timer;

            $(window).on('scroll', function () {
                if (timer) {
                    clearTimeout(timer);
                }
                timer = setTimeout(function () {
                    scrolled();
                }, 10);
            });

            function scrolled() {
                var scrollPosition = Math.ceil(window.pageYOffset);
                if (scrollPosition + window.innerHeight >= $(document).height()) {
                    showHeader();
                } else if (scrollPosition === 0) {
                    header.removeClass("header-section_sticky");
                    header.removeClass("header-section_hide");
                    dispatchEvent("removeClassFromSecondaryNavigation");
                    headerWrapper.css("height", "");
                } else {
                    header.addClass("header-section_hide");
                    header.removeClass("header-section_sticky");
                    dispatchEvent("removeClassFromSecondaryNavigation");
                }
            }

            function showHeader() {
                dispatchEvent("addClassToSecondaryNavigation");
                header.addClass("header-section_sticky");
                header.removeClass("header-section_hide");
                headerWrapper.css("height", "64px");
            }

            function dispatchEvent(eventName) {
                var event = new CustomEvent(eventName);
                document.dispatchEvent(event);
            }
        }
    };

})(jQuery);
